 ('2', '2', 'en_us', 'Landing', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Toeplusbee.com will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2016-04-05 21:11:55', '2016-06-09 13:21:51', 'fdbd5bb5-360e-4f59-ac3b-ff6d1ee4f50c'),
 ('3', '3', 'en_us', 'Tubular X', '<p>Craft is the CMS that’s powering Toeplusbee.com. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', 'Adidas Originals', '2015', 'half', NULL, NULL, NULL, NULL, NULL, '2016-04-05 21:11:56', '2016-07-12 10:17:05', '4d404443-764c-4e36-8d03-d3dc3704ca4b'),
